    const [add, setAdd] = useState(0);
    const [sub, setSub] = useState(100);


    function high(){
        return add * 10
    }
  return (
    <div>
        <h1>Learning usememo</h1>
       <span> {high}</span>
       <br/>
        <button onClick={()=>setAdd(add + 1)}>Addition</button>
        <span>{add}</span>
        <br/>
        <button onClick={()=>setSub(sub - 1)}>subtraction</button>
        <span>{sub}</span>
      
    </div>
  )
}

export default Usem
